import FoodList from "./FoodList.js";
import items from "../mock.json";

function App() {
  const sortedItems = items.sort((a, b) => b.calorie - a.calorie);
  return (
    <div>
      <FoodList items={sortedItems} />
    </div>
  );
}

export default App;
